import React, { Component } from 'react';
import {BrowserRouter, Link} from 'react-router-dom';

class UserLogin extends Component {
    render() {
        return (
            <BrowserRouter>
            <div>
                <h1>heyy</h1>
                <p>this is login</p>
                <li><a href ="/userSignup"> User Signup</a></li>
            </div>
            </BrowserRouter>
        )
    }
}
export default UserLogin;
